static void fen_constructor()
{
	Engine juicer;

	for (std::string fen: GAME_FENS)
	{
		juicer.seed(fen);
		mu_assert(juicer.position().key == Zobrist::hash(juicer.position()), 
				  fen + ": " + std::to_string(juicer.position().key) + ", " + std::to_string(Zobrist::hash(juicer.position())));
	}
}

static void make_moves()
{
	Engine juicer;

	for (std::string fen: GAME_FENS)
	{
		juicer.seed(fen);
		for (const Move& m: MoveList<LEGAL>(juicer.position()))
		{
			std::string current_fen = FEN::string(juicer.position());
			juicer.make_move(m);
			mu_assert(juicer.position().key == Zobrist::hash(juicer.position()), UCI::move_to_string(m) + " " + current_fen);
			for (const Move& m: MoveList<LEGAL>(juicer.position()))
			{
				current_fen = FEN::string(juicer.position());
				juicer.make_move(m);
				mu_assert(juicer.position().key == Zobrist::hash(juicer.position()), UCI::move_to_string(m) + " " + current_fen);
				juicer.undo_move();
			}
			juicer.undo_move();
		}
	}
}


int main()
{
	mu_run(fen_constructor);
	mu_run(make_moves);

	return 0;
}
